import APIService from '../components/ApiService'

function Form(props) {

  const[email, setEmail] = useState(props.results.email)

  useEffect(() => {
    setEmail(props.results.email)
  },[props.result])

  const submitEmail = () => {
    APIService.submitEmail({email})
    .then(resp=> console.log(resp))
    .catch(error => console.log(error))

  }
  return (
    <div>
      <button
      onClick = {submitEmail}
      className = "btn btn-success mt-3"
      >Submit</button>
    </div>





    )



}

export default Form
